import Contacts from "../Contacts/Contacts";


export default class Home extends Component{

    state = {
    }
    render() {
        return <>
        <div className="container">
                <div className="bg-dark p-4">
                <div className="row gy-3">
                {this.props.productDetails.map((x,index) => <Contacts productIndex={index} update={this.props.update} delete={this.props.delete} key={index} productDetails= {x} />)}
                </div>
                </div>
        </div> 
        </>
            
        
        
    }
}
